import React, { useState } from 'react';

const TotalKeranjang = ({keranjangPost}) => {

	console.log(keranjangPost)
	return (
		<div className="total-keranjang">
			{keranjangPost && keranjangPost.map(keranjang => {
				return(
					<h1>{keranjang.total_harga}</h1>
				)
			})}
		</div>
	)
};

export default TotalKeranjang;
